        private TzDatabase.TzZone GetZone(ref DateTime point)
        {
            TzDatabase.TzZone targetZone = null;
            foreach (TzDatabase.TzZone zone in Info.Zones)
            {
                if (!zone.IsGreaterThanUntil(point))
                {
                    targetZone = zone;
                    break;
