            start = end = null;

            // We search over all rules, looking at only those rules with
            // the rule name that is passed in. The first rule that we find
            // which has a FromYear less than the point's year and a ToYear
            // grater than the point's year is the year of the rule we want to use
            foreach (TzDatabase.TzRule rule in Info.Rules)
            {
                if (rule.RuleName == ruleName)
                {
                    if (point.Year >= rule.FromYear &&
                        point.Year <= rule.ToYear)
                    {
                        if (start == null)
                        {
                            start = rule;
                        }
                        else if (end == null)
                        {
                            end = rule;
                        }
                        else
                        {
