            {
                if (m_cachedUntilTime == null)
                {
                    m_cachedUntilTime = GetDateTime(UntilYear, UntilMonth, UntilDay, UntilDay_DayOfWeek, UntilTime);
                }
                return m_cachedUntilTime.Value;
